export async function deleteWebhookMessage(bot, webhookId, webhookToken, messageId, options) {
    let url = bot.constants.endpoints.WEBHOOK_MESSAGE(webhookId, webhookToken, messageId);
    // QUERY PARAMS
    if (options?.threadId) {
        url += `?threadId=${options.threadId}`;
    }
    await bot.rest.runMethod(bot.rest, "delete", url);
}
